  return (
    <div className="App">
      {/* Include the Header component */}
      <Header username="Your Username" />
      <main>
        <p>This is the main content of the app.</p>
      </main>
      <footer>
        <p>&copy; 2024 My App</p>
      </footer>
    </div>
  );
}

export default App;
